import React, { useState } from 'react'
import PageHeader from './PageHeader';
import * as FaIcons from 'react-icons/fa';
import { Paper, makeStyles, TableBody, TableRow, TableCell, Toolbar, InputAdornment, IconButton,TextField } from '@material-ui/core';
import useTable from "../useTable";
import Controls from "../controls/Controls";
import SearchIcon from '@material-ui/icons/Search';
import Popup from "../Popup";
import * as deliveryService from '../services/deliveryService'
import PrintIcon from '@material-ui/icons/Print'
import axios from 'axios'
import easyinvoice from 'easyinvoice';

const useStyles = makeStyles(theme => ({
  pageContent: {
      margin: theme.spacing(5),
      padding: theme.spacing(3)
  },
  searchInput: {
      width: '75%'
  },
  newButton: {
      position: 'absolute',
      right: '10px'
  }
}))

const headCells = [
  { id: 'id', label: 'CN.No'},    
  { id: 'bookingDate', label: 'CN.Date'},
  { id: 'consignorName', label: 'Consignor '},
  { id: 'consigneeName', label: 'Consignee '},
  { id: 'shippingAddress', label: 'ShippingAddress' },
  { id: 'delivery', label: 'Courier'},
  { id: 'status', label: 'Status'},
  { id: 'action', label: 'Action'},
  
]


function Delivery() {

 // alert(JSON.stringify(deliveryService.getAlldeliveries()))
  const classes = useStyles();
  const[id,setId] = useState(null);
  const [records, setRecords] = useState(deliveryService.getAlldeliveries())
  var alldbUs=[]
  axios.get('/tms/booking/allitems')
        .then(res=>{
            res.data.forEach(element=>{
                alldbUs.push(element)
            })      
            //setRecords(alldbUs)
        })
        .catch(err=>{
            console.log(err)
    })
    var prod=alldbUs
//   var alldbUs=[]
//   const [records, setRecords] = useState([])
//   axios.get('/tms/delivery/alldeliveries')
//       .then(res=>{
//           res.data.forEach(element=>{
//               alldbUs.push(element)
//               console.log(element)
//           })      
//           setRecords(alldbUs)
//       })
//       .catch(err=>{
//           console.log(err)
//       })
  const [filterFn, setFilterFn] = useState({ fn: items => { return items; } })
  const [openPopup, setOpenPopup] = useState(false)
    const {
      TblContainer,
      TblHead,
      TblPagination,
      recordsAfterPagingAndSorting
  } = useTable(records, headCells, filterFn);

  const handleSearch = e => {
      let target = e.target;
      setFilterFn({
          fn: items => {
              if (target.value == "")
                  return items;
              else
                  return items.filter(x => x.vehicleNo.toLowerCase().includes(target.value))
          }
      })
  }
  
  
  const openInPopup = item => {
      setOpenPopup(true)
      setId(item.id)
  }


  const renderReciept = (item) => {
    const cuProd=prod.filter(it=>it.id==item.id)
    const data = {
        
        "currency": "USD", 
        //Defaults to no currency. List of currency codes: https://www.iban.com/currency-codes
        
        "taxNotation": "vat", //or gst
        "marginTop": 25,
        "marginRight": 25,
        "marginLeft": 25,
        "marginBottom": 25,
        //"logo": "https://public.easyinvoice.cloud/img/logo_en_original.png", //or base64
        //"logo":"https://pbs.twimg.com/profile_images/738307757401464837/HMNmpDF1_400x400.jpg",
        "logo":"",    
        "sender": {
          "company": item.consignorName,
          "address": "TMS "+item.from,
          "zip": "42300",
          "city": item.from,
          "country": "Pakistan"
          //"custom1": "custom value 1",
          //"custom2": "custom value 2",
          //"custom3": "custom value 3"
        },
        "client": {
          "company": "Bill To: ",
          "address": item.consigneeName,
          "zip": "4567 CD ",
          "city": item.shippingAddress,
          "country": "Pakistan"
          //"custom1": "custom value 1",
          //"custom2": "custom value 2",
          //"custom3": "custom value 3"
        },
        "invoiceNumber": "2021.000"+item.id,
        "invoiceDate": item.bookingDate.substring(0,10),
        "products": 
        [
            {
                "quantity": cuProd[0].quantity,
                "description": cuProd[0].productDetails,
                "tax": cuProd[0].TaxRate,
                "price": item.valueofGoods/160
            }
        ],
        "bottomNotice": "This GatePass Has been Issued to "+ item.consigneeName + " \n For MisPrinting, Report to Admin",
        //Used for translating the headers to your preferred language
        //Defaults to English. Below example is translated to Dutch
        // "translate": { 
        //     "invoiceNumber": "Factuurnummer",
        //     "invoiceDate": "Factuurdatum",
        //     "products": "Producten", 
        //     "quantity": "Aantal", 
        //     "price": "Prijs",
        //     "subtotal": "Subtotaal",
        //     "total": "Totaal" 
        // }
      }; 
    //alert(JSON.stringify(data))
    easyinvoice.createInvoice(data, (result) =>{
        //console.log(result.pdf)
        setOpenPopup(true);
        easyinvoice.render('reciept',result.pdf,()=>{
            console.log('invoice rendered')
        })
        easyinvoice.download('gatepass',result.pdf,()=>{
            console.log('invoice rendered')
        })
    } );
       
    
}


  return (
    <div className='delivery'>
      <PageHeader title="Delivery of Consignments" subTitle="All Consignments that has been delivered or need to be delivered" icon={<FaIcons.FaShippingFast/>} />
      <Paper className={classes.pageContent}>

      <Toolbar>
      <TextField
                label="Search Conisgnments that have issued Gatepass"
                className={classes.searchInput}
                InputProps={{
                    endAdornment: (<InputAdornment position="start">
                       <IconButton>
                       <SearchIcon/>
                        </IconButton>                  
                    </InputAdornment>)
                }}
                onChange={handleSearch}
            />
          
      </Toolbar>
      <TblContainer>
          <TblHead />
          <TableBody>
              {
                  recordsAfterPagingAndSorting().map(item =>
                      (<TableRow key={item.id}>
                          <TableCell>PKG00{item.id}</TableCell>
                          <TableCell>{item.bookingDate.substring(0,10)}</TableCell>
                          <TableCell>{item.consignorName}</TableCell>
                          <TableCell>{item.consigneeName}</TableCell>
                          <TableCell>{item.shippingAddress}</TableCell>
                          <TableCell>{item.transportCompany.toUpperCase()}</TableCell>
                          <TableCell style={{fontWeight:'bold', fontSize:'16px',color:'green',animation:'ease-in-out'}}>GatePass Issued</TableCell>
                          <TableCell>
                            <Controls.ActionButton
                                color="primary"
                                onClick={() => renderReciept(item) }
                            >
                                <PrintIcon fontSize="small" />
                            </Controls.ActionButton>
                            </TableCell>
                          </TableRow>)
                  )
              }
          </TableBody>
      </TblContainer>
      <TblPagination />
      </Paper>
      <Popup style={{fontSize:'5px',padding:'0'}}
      title="GatePass Reciept"
      openPopup={openPopup}
      setOpenPopup={setOpenPopup}
      >
          <div id='reciept'></div>
      </Popup>
    </div>
  );
}

export default Delivery;
